  modulator = new p5.Oscillator('sawtooth');
  modulator.disconnect();
  modulator.amp(1);
  modulator.freq(4);
  modulator.start();

  // Modulator's default amplitude range is -1 to 1.
  // Multiply it by -200, so the range is -200 to 200
